import React from "react";

export const Card = props => {
  return (
    <div>
      <h1>
        <img src={props.user.avatar_url} alt="img" />
        <h1>login: {props.user.login}</h1>
        <p>location: {props.user.location}</p>
        <p>repos: {props.user.public_repos}</p>
        <p>bio: {props.user.bio}</p>
      </h1>
    </div>
  );
};
